import React from 'react';
import cover_image from '../images/cover_image'

const CoverImage = () => {
  const coverImageStyle = {
    position: "block",
    zIndex: "-100",
    height: "30vh",
    width: "100%",
    maxWidth: "400px",
    objectFit: "cover"
  }

  return(
    <>
      <img style = {coverImageStyle} src={cover_image} alt=""/>
    </>
  )
}

export default CoverImage;
